import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import './Login2.css';


function Register() {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [phoneNumber, setPhoneNumber] = useState('');
  const [dateOfBirth, setDateOfBirth] = useState('');
  const [email, setEmail] = useState('');
  const [message, setMessage] = useState('');
  const navigate = useNavigate();

  const handleRegister = (e) => {
    e.preventDefault();
    if (password !== confirmPassword) {
      setMessage('Passwords do not match');
      return;
    }
    // Implement your registration logic here
  };

  return (
    <div className="wrapper">
      <div className="register-box">
        <form onSubmit={handleRegister}>
          <h1>Sign up</h1>
          <div className="input-box">
            <input type="text" placeholder="First Name" required value={firstName} onChange={(e) => setFirstName(e.target.value)} />
            <i className='bx bxs-user'></i>
          </div>
          <div className="input-box">
            <input type="text" placeholder="Last Name" required value={lastName} onChange={(e) => setLastName(e.target.value)} />
            <i className='bx bxs-user'></i>
          </div>
          <div className="input-box">
            <input type="text" placeholder="Phone Number" required value={phoneNumber} onChange={(e) => setPhoneNumber(e.target.value)} />
            <i className='bx bxs-phone'></i>
          </div>
          <div className="input-box">
            <input type="date" placeholder="Date of Birth" required value={dateOfBirth} onChange={(e) => setDateOfBirth(e.target.value)} />
            <i className='bx bxs-calendar'></i>
          </div>
          <div className="input-box">
            <input type="email" placeholder="Email" required value={email} onChange={(e) => setEmail(e.target.value)} />
            <i className='bx bxs-envelope'></i>
          </div>
          <div className="input-box">
            <input type="text" placeholder="Username" required value={username} onChange={(e) => setUsername(e.target.value)} />
            <i className='bx bxs-user'></i>
          </div>
          <div className="input-box">
            <input type="password" placeholder="Password" required value={password} onChange={(e) => setPassword(e.target.value)} />
            <i className='bx bxs-lock'></i>
          </div>
          <div className="input-box">
            <input type="password" placeholder="Confirm Password" required value={confirmPassword} onChange={(e) => setConfirmPassword(e.target.value)} />
            <i className='bx bxs-lock'></i>
          </div>
          <button type="submit" className="btn">Sign up</button>

          <div className="register-link">
            <p>Already have an account? <Link to="/login">Login</Link></p>
          </div>
          {message && <p>{message}</p>}
        </form>
        <button className="btn" onClick={() => navigate('/')}>Home</button>
      </div>
    </div>
  );
}

export default Register;
